<?php

require_once 'kitku/kitku.php';

if (!empty($_FILES) || !empty($_POST)) {
    
    echo "_FILES\r\n";
    $image = new KitkuImageUploader ($_FILES['the-file']['tmp_name'], 'images/', '_FILES_test', 'path');
    $image->save_full_res();
    echo "\r\n";
    var_dump($image);
    echo "\r\n";
    echo "\r\n";

    echo "_POST\r\n";
    $image = new KitkuImageUploader ($_POST['base64'], 'images/', 'filename', 'base64');
    $image->save_full_res();
    echo "\r\n";
    echo "\r\n";
    echo "\r\n";

    exit();
}

?>

<form id='test' onsubmit="return new_post(event);">
    <input type="file" name="the-file"></input>
    <br />
    <input type="submit"></input>
</form>

<script>

function new_post(e) {
    e.preventDefault();

    console.clear();
    
    const form = document.forms['test'];
    const fd = new FormData(form);
    fd.append('base64',
    'data:image/jpeg;base64,'
    );

    const xhttp = new XMLHttpRequest();
            xhttp.open('POST', 'test.php', true);
            xhttp.send(fd);

    xhttp.onreadystatechange = function() {
        if (this.readyState == 4 && this.status == 200){
            const result = this.responseText;
            console.log(result);
        }
    }
}

</script>